import { fileURLToPath } from 'node:url';
import { spawn } from 'node:child_process';
import path from 'node:path';
import { parseArgs } from 'node:util';

const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);
const launcherPath = path.resolve(__dirname, '../launcher/core/launcher.mjs');

function main() {
  const { values, positionals } = parseArgs({
    options: {
      profile: { type: 'string', short: 'p', default: 'weibo_fresh' },
      url:     { type: 'string', short: 'u', default: 'https://weibo.com' },
      headless:{ type: 'boolean', short: 'h', default: false }
    },
    allowPositionals: true
  });

  const profile = values.profile;
  const url     = values.url;
  const headless = values.headless;

  // æ˜¾ç¤ºå¯åŠ¨ä¿¡æ¯
