  const args = [launcherPath, '--profile', profile, '--url', url];
  if (headless) {
    args.push('--headless');
  }

  const child = spawn('node', args, {
    stdio: 'inherit',
    env: {
      ...process.env,
      WEBAUTO_HEADLESS: headless ? '1' : '0'
    }
